import VueRouter from 'vue-router'
import connect from './components/connectWallet'
Vue.use(VueRouter)

const router = new VueRouter({
 routes:[
    {
        path:'/connectWallet',
        component:connectWallet
      },
    {
        path: '/',
        redirect: '/connectWallet'
    }
 ]
})

export default router
